import React, { Component } from 'react'
import "."

export default class Button extends Component {
    constructor() {
        super()
        this.state = {
            isClicked: ''
        }
    }


    render() {
        return (
            <div>
                <button onClick={() => this.setState({isClicked: 'underline'})} classname={this.state.isClicked === 'underline' ? 'underline' : ""}>
                    underline me
                </button><br />
                <button>
                    Italicize me
                </button><br />
                <button>
                    I'm bold!
                </button>
            </div>
        )
    }
}
